// components/Tile.js
import styles from './Tile.module.css'

  const Tile = (props) => (
    <div className={styles.tileStyle}>
        <div className="topHalf">
            <h1>h</h1>
            <img className={styles.photo} src={props.src}></img>
        </div>
      <div className="bottomHalf">
          <h1>Hello</h1>
          <p>Life is good</p>
      </div>
      {props.children}
    </div>
  );

  export default Tile;
